Che vi devo dire? Li ho visti nascere, crescere e morire. 
Non ci sono parole per descrivere la tristezza di questa cosa. Una delle band migliori d’Italia abbandona la scena, non ci saranno più concerti come quelli di domenica sera. Ed è un po’ come la fine di un era, vuol dire che stiamo davvero invecchiando. 
